using Swashbuckle.AspNetCore.Annotations;

namespace MGP.Discapacidad.API.Controllers.V1.Document.Request;

[SwaggerSchema("Contains the necessary information to add a template",
    Required = ["Id", "DocumentTypeId", "DocumentUrl"])]
public class AddTemplateRequestModel
{
    /// <example>1</example>
    [SwaggerSchema("CUD, SUBE, ETC")]
    public int TicketTypeId { get; set; }

    /// <example>data:application/pdf;base64,</example>
    [SwaggerSchema("Template Base 64")]
    public string DocumentPDF { get; set; }

    /// <example>Patologías Cardiovasulares</example>
    [SwaggerSchema("Cardiovascular")]
    public string Name { get; set; }

    /// <example>Necesitamos que descargues esta planilla, la hagas completar y firmar por un médico, y luego la subas como documentación de tipo Planilla Oficial</example>
    [SwaggerSchema("Information")]
    public string Information { get; set; }
}
